def load_config():
    with open("config.json", "r") as f:
        return json.load(f)

def get_country():
    url = f"https://scoresaber.com/api/player/{player_id}/basic"
    response = requests.get(url,timeout=10)
    COUNTRY=response.json().get("country", [])
    print("country set to "+COUNTRY)
    return COUNTRY

config = load_config() 
player_id = config["PLAYER_ID"]
MAX_MAPS = config["MAX_MAPS"]
SORT = config["SORT"]
TARGET = config["TARGET"]
COUNTRY = get_country()
PASDERATELIMITSVP = config["I_PROMISE_IM_NOT_DDOSING"]
Check_SS = config["CHECK_SCORESABER"]
Check_newMaps = config["CHECK_NEW_MAPS"]
LastUpdate = config["last_refresh"]


def update_last_refresh():
    try:
        with open("config.json", "r", encoding="utf-8") as f:
            config = json.load(f)
    except (FileNotFoundError, json.JSONDecodeError):
        config = {}

    config["last_refresh"] = datetime.now().strftime("%Y-%m-%d_%H-%M-%S")

    with open("config.json", "w", encoding="utf-8") as f:
        json.dump(config, f, indent=4)
    
    return config["last_refresh"]

def get_all_scores(player_id):
    all_scores = []
    page = 0
    while (len(all_scores) < MAX_MAPS or MAX_MAPS==-1):
        page+=1
        url = f"https://scoresaber.com/api/player/{player_id}/scores?sort={SORT}&page={page}"
        response = requests.get(url,timeout=10)
        print(f"API response to page {page}: {response.status_code}")
        if response.status_code != 200:
            print(f"Error at page {page} (status {response.status_code})")
            break
        scores = response.json().get("playerScores", [])
        if not scores:
            print(f"Data ends at page {page}")
            break
        all_scores.extend(scores)
        time.sleep(PASDERATELIMITSVP)

    print(f"Total : {len(all_scores)} scores collected on {page} pages.")
    return all_scores
    
def filter_ranked(scores):
    ranked_scores = []
    paranked=0
    for entry in scores:
        if entry["leaderboard"]["ranked"]:
            ranked_scores.append(entry)
        else:
            paranked+=1
    print(str(paranked)+" unranked scores , "+str(len(ranked_scores))+" ranked scores.")
    return ranked_scores

def get_country_rank(hash_, DiffInt, country, player_id):
    page = 1 
    while True:
        url = f"https://scoresaber.com/api/leaderboard/by-hash/{hash_}/scores?difficulty={DiffInt}&countries={country}&page={page}"
        response = requests.get(url)

        if response.status_code == 200:
            data = response.json()
            scores = data.get("scores", [])
            
            for i, score in enumerate(scores, start=1):
                if score["leaderboardPlayerInfo"]["id"] == player_id:
                    return i  

            if not scores or len(scores) < 1:
                return None
            else:
                page += 1
        else:
            print(f"Getting country rank: request error at page {page} (code: {response.status_code})")
            return None 


def gen_playlist_countryRank():
    df = pd.read_csv("scoresaber_ranked_with_country_rank.csv")
    playlist = {
        "playlistTitle": "",
        "playlistAuthor": "la poupette",
        "songs": [],
        "image": "base64," + image_to_base64("cover.png")
    }
    print("Generating playlist...")
    sum=0
    huh=0
    comptTarget=0

    huhs = []

    for _, row in df.iterrows():
        if(isinstance(row["CountryRank"], int)):
            sum+=row["CountryRank"]
            if row["CountryRank"] > TARGET:
                comptTarget+=1
                match = re.match(r"_(.+)_Solo((?:[A-Z][a-z]*)+)", row["Difficulty"])
                if not match:
                    print("Difficulty format error at: "+row["Song"]+" - "+row["Song"]+"("+comptTarget+")" )
                    continue

                diff, charac = match.groups()

                playlist["songs"].append({
                    "songName": row["Song"],
                    "levelAuthorName": row["Song"],
                    "hash": row["Hash"],
                    "levelid": f"custom_level_{row['Hash']}",
                    "difficulties": [{
                        "characteristic": charac,
                        "name": diff
                    }]
                })
        else:
            huh+=1
            huhs.append({"Song": row["songName"],"Level": row["difficulty"]["difficultyRaw"],"LevelAuthor": row["levelAuthorName"]})
    total = len(df)
    pourcentage = round(comptTarget / total * 100, 2) if total > 0 else 0
    playlist["playlistTitle"] = f"Snipe top {TARGET} {COUNTRY} ({total-comptTarget}/{total} : {100-pourcentage}%)"

    
    print("Country ranks OK, average country rank on sample: ",str(sum/(len(df)-huh)),", ",str(huh)," abnormalities (see above):", print(huhs))
    
    return json.dumps(playlist, indent=4)


def main():
    
    if Check_SS:
        if Check_newMaps:
            print("Collecting scores...")
            scores = get_all_scores(player_id)
        print("filtering ranked scores")
        rankedScores = filter_ranked(scores)

        data = []

        print("Collecting country rank data...")
        for entry in rankedScores:
            score = entry["score"]
            leaderboard = entry["leaderboard"]

            hash_ = leaderboard["songHash"]
            difficulty = leaderboard["difficulty"]["difficultyRaw"] #"difficultyRaw": "_Expert_SoloStandard"
            DiffInt = leaderboard["difficulty"]["difficulty"]

            countrank = get_country_rank(hash_, DiffInt, COUNTRY, player_id)

            if (len(data)%5==0):
                print(str(round(100*len(data)/len(rankedScores),2))+"% of ranked leaderboards checked")

            data.append({
                "Song": leaderboard["songName"],
                "Level": leaderboard["difficulty"]["difficultyRaw"],
                "LevelAuthor": leaderboard["levelAuthorName"],
                "PP": score["pp"],
                "Accuracy": score["modifiedScore"] / leaderboard["maxScore"] if leaderboard["maxScore"] else 0,
                "Score": score["modifiedScore"],
                "Rank": score["rank"],
                "CountryRank": countrank,
                "Hash": hash_,
                "DiffInt": DiffInt,
                "Difficulty": difficulty
            })

            time.sleep(PASDERATELIMITSVP)

        df = pd.DataFrame(data)

        update_last_refresh()

        df.to_csv("scoresaber_ranked_with_country_rank.csv", index=False)
        print(f"'scoresaber_ranked_with_country_rank_{config["last_refresh"]}.csv' file succesfully generated.")


    LastUpdate = config["last_refresh"]

    with open(f"Playlist_Snipe_{SORT}_top{TARGET}_{COUNTRY}_{LastUpdate}.bplist", "w") as f:
        f.write(gen_playlist_countryRank())
    
    print("Playlist \""f"Playlist_Snipe_{SORT}_top{TARGET}_{COUNTRY}_{update_last_refresh()}.bplist","\" generated! Window will auto close")
    time.sleep(100*PASDERATELIMITSVP)


if __name__ == "__main__":
    if(TARGET<1):
        print("please enter a valid target")
    else:
        main()



